import React from "react";
import { ExperienceList } from "../../../data/ExperienceData";
import {
  Card,
  CardLeft,
  CardRight,
  Stack,
  BtnGroup,
} from "./ExperienceCardElements";
function ExperienceCard() {
  return (
    <>
      {ExperienceList.map((list, index) => (
        <Card key={index}>
          <CardLeft>
            <img src={list.img} alt={list.name} />
          </CardLeft>
          <CardRight>
            <h4>{list.title}</h4>
            <p>{list.timeline}</p>
            <p>{list.technologies}</p>
            <Stack>
              {/* <span className="stackTitle">Coursework:</span> */}
              <span className="tags">{list.description}</span>
            </Stack>
            <BtnGroup>
              {/* <a
                className="btn btn2 SecondarBtn"
                href={list.github_url}
                target="_blank"
                rel="noopener noreferrer"
              >
                Github
              </a> */}
              <a
                className="btn PrimaryBtn"
                href={list.website}
                target="_blank"
                rel="noopener noreferrer"
              >
                Website âžœ
              </a>
            </BtnGroup>
          </CardRight>
        </Card>
      ))}
    </>
  );
}

export default ExperienceCard;
